## Why Navigation is Important

In this tutorial we will look at creating a common element present on almost every website... a responsive navigation bar.

> If they can't find it, they won't see it

Navigation is your website's way of showing how you architected your website, and a structured and simple navigation will give users a much better experience in finding what they essentially are on your site for.

## Getting Started

I'm assuming you know how to begin a react project. If you don't visit the [Create React App](https://reactjs.org/docs/getting-started.html "create react app") or [Gatsby Js](https://www.gatsbyjs.org/docs/ "gatsby js") website to get an application up and running.
Create a header component `header.jsx` and create the basic JSX structure for your header.
`header.jsx`
```
import React from 'react';

const Header = () => (
  <nav className="menu">
    <ul>
      <li>
        <a href="/">Home</a>
      </li>
      <li>
        <a href="/about">About</a>
      </li>
      ...
    </ul>
  </nav>
);

export default Header;
```

## Link a CSS File

