```

We are going to want a logo on the left and our menu on the right. Keeping that in mind, it's now time to start styling the main navigation.

Inside `header.css` add the following CSS to align our navigation to the right and inline.

```
.menu ul {
  padding: 0;
  display: flex;
  margin: 0;
  justify-content: flex-end;
  list-style: none;
}

.menu ul li {
  margin: 0 20px;
}

.menu ul li a {
  text-decoration: none;
}
```

Side note: `.menu` is a very common className and could cause problems if there are other classes named menu on your site. For demonstrational purposes I am leaving it simple here but it would be in your best interest to either use CSS modules or name it something more unique.

## Add a logo

For a logo, any image can be used. I like SVG's because of their good resolution (they use vector based paths), speed, and ability to be animated. If you want to create a text based logo SVG, I used [Google font to SVG path](https://danmarshall.github.io/google-font-to-svg-path/ "google font to SVG path") which allows you to choose a font-family, type your text, and it will spit out an SVG you can use as a logo.

Create an Icon component at the top of `header.jsx` with the svg as such:
```
const Icon = () => (
  <svg viewBox="0 0 50 50" className="logoItem">
    <path
      d="M 47.266 20.362 L 47.266 57.52 L 38.379 57.52 A 26.601 26.601 0 0 1 37.228 57.497 Q 36.159 57.45 ..."
    />
  </svg>
);
```

Add the logo to `header.jsx` before the navigation component and link it to your home page.

```
const Header = () => (
  <div className="logoBox">
    <a href="/">
      <Icon />
    </a>
  </div>
  <nav className="menu">
  ...
);
```

This will cause a parsing error as JSX expressions must have only one parent element. We can get around this by using [React Fragments](https://reactjs.org/docs/fragments.html "react fragments"). A React Fragment is a way to insert children without adding extra nodes to the DOM.

```
const Header = () => (
  <>
    <div className="logoBox">
      <a href="/">
        <Icon />
      </a>
    </div>
    <nav className="menu">
    ...
  </>
);
```

Style the logo container

```
.logoBox {
  width: 50px;
  height: 50px;
  margin: 0;
  padding: 5px;
  background: rgba(255, 255, 255, 0.2);
  border-radius: 10px;
}
```

Update the ViewBox attribute which defines the aspect ratio of the image. viewBox="0 0 100 100": Defines a coordinate system 100 units wide and 100 units high. ViewBox="-50 -50 100 100": A view with the same scale, but now with the top-left corner given the coordinates (-50, -50). A viewBox of -25 -25 100 100 is what fit my needs for this project and my SVG.

```
const Icon = () => (
  <svg viewBox="-25 -25 100 100" className="logoItem">
  ...
```


## Style the Navigation Bar

Now we want to style our navigation bar so it looks good on a desktop view.

Change the React Fragments to a container div so we can use Flexbox to align the logo and the navigation menu links.

`header.jsx`
```
const Header = () => (
  <div className="headerContent">
    <div className="logoBox">
    ...
);
```

`header.css`
```
.menu {
  width: 90%;
}

.headerContent {
  display: flex;
  justify-content: center;
  align-items: center;
}
```

And now we should have something that is starting to look like a navigation!

![Responsive Header 1](//images.ctfassets.net/xckcqgv0vy98/3cWfyuaVZGVhbI6Msvei4R/dcb7a71906904b5f5c2c6671ce5d78aa/responsive-header-1.png)

## Let's Make It Responsive!

First add a media query to hide the links once our desktop view is too small to show them all. We will want the mobile menu to be full width and a fixed position. We use visibility hidden so we can animate the menu in later. 

`header.css`
```
@media screen and (max-width: 767px) {
  .menu {
    position: fixed;
    top: 0;
    visibility: hidden;
    right: -100%;
    bottom: 0;
    width: 100%;
   z-index: 1;
    background: rgba(0, 0, 0, 0.8);
    z-index: 999;
    padding: 80px 0 0;
    transition: all .3s;
   }
}
```

Now we will need something to replace the links so we can show them again on mobile. This is typically done with a hamburger menu. We will do this with SVG's the same way we created our logo for the ability to animate it easily. We will make it a button for accessibility.

`header.jsx`
```
const Hamburger = () => (  
  <button className="hamburger">
    <svg viewBox="0 0 100 80" width="40" height="40">
      <rect width="100" height="10"></rect>
      <rect y="30" width="100" height="10"></rect>
      <rect y="60" width="100" height="10"></rect>
    </svg>
  </button>
);

const Header = () => (
  <div className="headerContent">
    <div className="logoBox">
      ...
    </div>
    <Hamburger />
    <nav className="menu">
```

`header.css`
```
.hamburger {
  display: none;  background: transparent;
  border: none;
  outline: none;
  z-index: 9999;

}
@media screen and (max-width: 767px) {
  .hamburger {
    display: block;
  }
}
```

To space them out correctly we will want to have the hamburger menu on the right side and can achieve this by adding an extra container div to the logo that will have a width of 100% minus however big our hamburger menu is.

`header.jsx`
```
const Header = () => (
  <div className="headerContent">
    <div className="logoContainer">
      <div className="logoBox">
        <a href="/">
```
`header.css`
```
@media screen and (max-width: 767px) {
  .logoContainer {
    width: calc(100% - 53px);
  }
}
```

## Add Functionality!

First we will want to add an onclick handler to our hamburger menu to update the state of our application. We can use a React hook, useState, to achieve this. We will update the state on click and we need to pass this function down to our Hamburger component so it updates accordingly.

`header.jsx`
```
import React, { useState } from 'react';

const Hamburger = ({onClick}) => (
  <button className="hamburger" onClick={onClick}>
    <svg viewBox="0 0 100 80" width="40" height="40" >
    ...
);

const Header = () => {
  const [isOpen, setIsOpen] = useState(false);

  const menuClass = isOpen ? 'menu open' : 'menu';

   return (
    <div className="headerContent">
    ...
    <Hamburger onClick={() => setIsOpen((prevState) => !prevState)} />
```

`header.css`
```
.menu.open {
  right: 0;
  visibility: visible;
}

.menu.open ul {
    flex-wrap: wrap;
    flex-direction: column;
    width: 100%;
    height: 100%;
    justify-content: flex-start;
  }

  .menu.open ul li {
    margin: 0;
  }

  .menu.open ul li a {
    display: inline-block;
    width: 100%;
    border-bottom: 1px solid #fff;
    box-sizing: border-box;
    font-size: 14px;
    font-weight: 600;
    padding: 20px;
    color: white;
    text-align: center;
  }

  .menu.open ul li a:hover {
    background-color: rgba(255, 255, 255, 0.3);
  }
```

We can animate the hamburger to a close menu but for now we will keep it simple and create a close button separately and laod in dynamically.

`header.jsx`
```
const Close = ({onClick}) => (
  <button className="hamburger_close" onClick={onClick}>
    <svg viewbox="0 0 40 40">
      <path class="close-x" d="M 10,10 L 30,30 M 30,10 L 10,30" />
    </svg>
  </button>
);

const Header = () => {
  ....
  {isOpen && (
    <Close onClick={() => setIsOpen((prevState) => !prevState)} />
  )}
  {!isOpen && (
    <Hamburger onClick={() => setIsOpen((prevState) => !prevState)} />
  )}
  <nav className={menuClass}>
  ...
};
```

`header.css`
```

.hamburger_close {
  width: 50px;
  height: 50px;
  padding: 0;
  z-index: 9999;
  background: transparent;
  border: none;
}

.hamburger_close svg {
  width: 100%;
  height: 100%;
}

.close-x {
  stroke: black;
  fill: transparent;
  stroke-linecap: round;
  stroke-width: 5;
}
```

### And there you have it!! A simple responsive navigation header

This can be optimized furthor for accessiblity, added animations, and more. But this tutorial gets you the basic setup of a navigation bar that is mobile friendly and easy to iterate on.
